import 'dart:convert';List<GetPosts> welcomeFromJson(String str) => List<GetPosts>.from(json.decode(str).map((x) => GetPosts.fromJson(x)));String welcomeToJson(List<GetPosts> data) => json.encode(List<dynamic>.from(data.map((x) => x.toJson())));class GetPosts {  GetPosts({    this.userId,    this.id,    this.title,    this.body,  });  int userId;  int id;  String title;  String body;  factory GetPosts.fromJson(Map<String, dynamic> json) => GetPosts(    userId: json["userId"],    id: json["id"],    title: json["title"],    body: json["body"],  );  Map<String, dynamic> toJson() => {    "userId": userId,    "id": id,    "title": title,    "body": body,  };}